import React from "react";

class Login extends React.Component {
  state = {};
  render() {
    return (
      <div>
        <h1>Login</h1>
        <h4>Email address</h4>
        <input type="text"></input>
        <h4>Password</h4>
        <input type="text"></input>
        <br />
        <button>Login</button>
        <button>Signup</button>
      </div>
    );
  }
}

export default Login;
